INSERT INTO `_post` VALUES ('','世界诗歌日：永不过时的诗歌艺术','世界诗歌日：永不过时的诗歌艺术','“诗歌是语言自由的最纯粹表达形式之一。它是民族身份的构成要素，其不断推陈出新的特性彰显着文化的创造性能量。”\r\n——联合国教科文组织总干事2013年世界诗歌日致辞\r\n\r\n3月21日，是世界诗歌日。它始于1999年在巴黎举行的联合国教科文组织第30次大会的决定。\r\n世界诗歌日的主要目的是支持通过诗歌表达语言的多样性，并让濒危语言有机会在其社区内得以听到。此外，这一天也是为了支持诗歌回到诗朗诵的传统，促进诗歌教学，恢复诗歌与戏剧，舞蹈，音乐，绘画等艺术之间的对话，支持小型出版商和在媒体上创造富有魅力的诗歌形象，使诗歌艺术不再被视为是一种过时艺术，而是一种当今的艺术形式。\r\n\r\n在豆瓣阅读的发展过程中，诗歌从未缺席。上线伊始，就有《翟永明诗五首》、《黄灿然译特朗斯特罗姆诗12首》等免费诗歌作品。副本、黑蓝、世界文学、北大五四文学社等合作方为我们提供了大量诗歌。普珉、石可、茱萸、陈舸、二十月、王璞、流马、厄土、陈珂、叶晓阳、刘海川等活跃青年诗人上架了他们的电子诗集……不知不觉间，豆瓣阅读的“诗歌”标签下已经积累了一百多种作品，在全部作品中占据了极大比例。\r\n\r\n最近，我们又上架了女性诗刊《翼》的1至3期。 《翼》于1998年创刊于北京，主办人周瓒，推介当代女性作者及其作品。其作者群包括了 虹影、周瓒、唐丹鸿、翟永明、曹疏影、戴锦华、崔卫平等优秀女性作者。\r\n\r\n明天，也就是世界诗歌日当天，我们将集中上架十多部诗歌作品。其中包括湖南文艺出版社的“诗苑译林”丛书，叶芝、拜伦、波德莱尔、里尔克、爱伦·坡、狄兰·托马斯悉数登场。\r\n\r\n最重要的作品理应留在最后：明天上架的，还将包括《海子诗全集》。\r\n\r\n王小波曾经说过：一个人只拥有此生此世是不够的，他还应该拥有诗意的世界。——由此看来，诗歌永远不会是过时的艺术。',28,2,24,17,0,2,NULL,'2013-03-20 14:47:56',0),('/static/upload/post_img/2013/3/21/201332111143_046fa404c4ced0e129c2892bcfb42b20','起床','起床困难','每天起床, 都很困难.\r\n虽然现在每天入睡时间都非常正常, 可是早上还是起不来. 每天都需要我催!\r\n每天都能一起吃早餐了.\r\n每天搞鼓下这个小站点.',28,2,25,18,0,1,NULL,'2013-03-21 03:17:58',0),('/static/upload/post_img/2013/3/21/2013321111926_ea67a8bee9b7da526e914b9f6d68735e','甜点','甜点','自从换了工作, 很久都没有出去拍过照了, 翻到去年十一的几张照片.\r\n十一时是纪念日,  应她要求, 吃了顿西餐, 说起来我真是不靠谱耶, 纪念日还需要她去做主活动.',28,5,25,19,0,1,NULL,'2013-03-21 03:21:49',5),('/static/upload/post_img/2013/3/21/201332112757_0876448e61b03fec64268b4b9169b17c','清早','清早的地铁站','2012年12月24日.\r\n不记得那天是干什么事了, 起的很早, 去地铁站, 早上的地铁站人很少. 我想, 能每天都起这么早上班的人们, 都挺了不起.\r\n记得初到上海时, 在定西路上班, 早班的时候8点打卡, 那时候我也是每天7点前起床, 即时在冬天, 想想真是不可思议.',28,2,26,20,0,1,NULL,'2013-03-21 04:12:33',3),('','街头','很有意思的一张照片','http://farm9.staticflickr.com/8529/8571772069_64f554ed09_c.jpg\r\n超现实么?',28,2,27,21,NULL,0,NULL,'2013-03-21 04:26:06',0),('/static/upload/post_img/2013/3/21/2013321154711_f29e78f497c9896dc4a9822ba72087ed','街头','街头拍','http://farm9.staticflickr.com/8529/8571772069_64f554ed09_c.jpg\r\n很有意思.',28,2,27,22,0,1,NULL,'2013-03-21 07:47:32',1),('/static/upload/post_img/2013/3/24/201332416156_1f8e50066b97f4e213c1f82461804011','一个头像','一个头像','|  好久没上豆瓣 \r\n|  \r\n|  也许是每天的平静的生活下 藏着一颗躁动的心\r\n|  \r\n|  比较宅  喜欢运动这个应该不矛盾\r\n|  \r\n|  期待爱情  一个人却也过了那么久  \r\n|  \r\n|  想来一个人是过  两个人也是过  指不定爱情就是这样降临的',28,2,27,23,0,0,NULL,'2013-03-21 08:28:08',0),('/static/upload/post_img/2013/3/24/2013324151653_69cb618dfa41ffed45352564dc47de42','','地铁','',28,4,26,24,0,3,NULL,'2013-03-24 07:17:31',1),('/static/upload/post_img/2013/3/24/2013324155734_d48aacdd18152473ccce31af18118815','窗外','下雪了','下雪的窗外.\r\n2012年末, 再次飘雪了, 记得没错的话, 几乎来上海的这几年, 每年都会下雪, 但是听说上海本来冬天并不常下雪, 看到自己的作用了吧, 这么犀利的能力哪里找.',28,5,26,25,0,1,NULL,'2013-03-24 08:00:23',0),('/static/upload/post_img/2013/3/24/2013324204140_d23c3605ac7348dda9b836a2ea194846','西塘小店','','',28,3,26,26,0,1,NULL,'2013-03-24 12:42:15',2),('','所谓真正的知识分子','吴念真\r\n\r\n所谓真正的知识分子','吴念真\r\n\r\n所谓真正的知识分子\r\n \r\n真正的知识分子，是自己的知识贡献给知识比他低的人；\r\n而不是反过来利用知识，去掠夺知识比他不足的人。\r\n \r\n大约十年前，吴念真先生去法鼓山打禅三，在一次心得分享；\r\n他说：一般年轻人都说：只要我喜欢，我什么都可以，\r\n吴念真先生却说：只要我可以,我什么都喜欢。\r\n \r\n吴念真跟他的师父\r\n \r\n我的记忆力并不出色，但靠着常常回忆重要画面，以下叙述应该大致正确。\r\n \r\n吴念真生在九份金瓜石(地名)，那里的人无不跟挖矿有关系，聚集了说着各式各样腔调、混杂了许多地方方言的人，大家一起靠着矿讨饭吃。\r\n当时所有人都很贫苦，某种程度也因为大家都半斤八两的穷，而感情很好。\r\n村子里，除了正在上小学的小孩子，大人几乎都不识字，要与外地的游子书信往返，得靠一位先生（忘了正确的称呼，容我叫他……师傅）帮大 家 读信、写信。\r\n村子没有富人，这位师傅虽然也得挖矿，但因为看得懂字、帮大家做文字沟通，因而在村子里拥有崇高的地位。\r\n师傅不挖矿的时候，很喜欢看杂志。\r\n他订阅了一大堆文艺春秋之类的东西，也看一些日本的武士道小说、侦探小说。\r\n除了文学，师傅的吸收新知能力超强，也很有实验精神。\r\n当时盘尼西林（一种很经典的消炎药）是很稀有的药物，如果村子里的人受了伤，伤口发炎，得靠「自然好」，时间往往拖了很久，有时伤口还会恶化。\r\n看医生怎么可能？不都说大家都很穷吗，当然是看个屁。\r\n事情总要解决，那师傅单单看了杂志上对这种药物的介绍，想了想，就命令村子里的凑钱从外地乱买了一堆盘尼西林回来。\r\n买回来了，乱打药可是会出人命的，于是师傅叫自己的儿子把屁股挺起来，让他先打一点点看看。\r\n过了许久，儿子的伤口比较不痛了，也没什么过敏反应，于是------「这个药不错！」师傅结论。\r\n他立刻发出消息，请每个受伤的人都轮流过去让他打一针。\r\n听起来很恐怖喔！但在当时，师傅可是什么都可以搞定的万事通，大家都仰仗他。\r\n \r\n村子里的大老粗请师傅写信时，常嚷着：「师仔！你就跟他说，干你娘咧你这个夭寿孩子出去工作都这么久了，半毛钱都没有寄回家，啊再不寄钱回来，两个弟弟就没办法去上学啦！实在有够不孝！是要把我活活气死！」\r\n师傅点点头，一边写着一边复述：「吾儿，外出工作，辛苦了！但家里经济拮据你也很清楚，如果你领了薪水，别忘了家中还有两个弟弟要念书，寄点钱回 家吧。你离乡背井，还请多多照顾自己！父字。」\r\n抬起头问：「是不是这样？」「是是是！就是这个意思啦！」大老粗眉开眼笑，也许脸还红了。大抵如此。\r\n有一天，素有威严的师傅叫村子里所有的小孩在庙口集合，要大家乖乖坐好，写一篇「请外婆到九份吃拜拜」的邀请信，他要检查。\r\n小孩子哪敢反抗，全都开始写。\r\n写完了，师傅一个一个看了。\r\n第二天，师傅把正在玩的吴念真叫了过去。\r\n师傅说，他不是真的要大家写信邀请外婆，而是想看看这些小孩子里谁的文笔最好！那人就是吴念真。\r\n「有一天师傅会老，会死掉，那一天到的时候，就由你帮村子里的人读信、写信，知不知道？」师傅严肃地看着吴念真。\r\n我想当时吴念真一定很迷惘、却也很骄傲吧。\r\n \r\n后来师傅开始教导吴念真写信的基本礼仪、常用语法等等，也让吴念真试着替村人读信（将文诌诌的字眼，用大家都能理解的用语说清楚）、替村人写信（也发生了不少趣事）。\r\n村子里的人甚至凑了一笔钱，买了一只钢笔送给吴念真，意义自然是要吴念真好好地继承这份神圣的责任。\r\n有一天，吴念真的邻居 家收到了一封信。事情是这样的。\r\n那位邻居大婶的女儿，为了贴补家用，跟很多村子里的女孩一样，国小毕业后就去都市里当工厂女工，过了几年，再去茶室或酒家上班赚取更多的钱。\r\n在当时虽然很多人都是这样，却仍是逼不得已。\r\n那个孝顺的女儿，某天带了一个在茶室认识的男人回家，说要结婚。\r\n女儿认识了不嫌弃她工作与出身的男人，应该替她高兴，但大婶还是难过地说：「妈妈知道妳辛苦，但家里真的需要妳这份薪水，妳能不能再多辛苦两年？两年过后，再结婚好不好？」\r\n女儿大哭一场后，回到都市后与男人分手，继续在茶室里陪客。\r\n过了两年，女儿又带了一个彬彬有礼的男人回家 ，喜孜孜地说要结婚。\r\n不料，那位大婶还是难过地说了同样的话，诸如弟弟妹妹们都还在念书，还是需要她那份薪水，希望她女儿可以再辛苦两年……\r\n这两年都活在希望里的女儿痛苦异常，在大哭中答应了她的母亲。与那位深爱她的男人回到都市后，提出了分手。\r\n过了很多天，邻居大婶收到了一封来自那男人的信。\r\n师傅去挖矿了，于是换吴念真出马。\r\n吴念真说，他忘了那封信精确说了什么，有些艰涩的用字他也看不是很懂，但他清晰地记得六个字，叫「虎毒尚不食子」。\r\n当他将这六个字原原本本念了出来时，那位大婶发疯地地跑去撞墙，凄厉地哭喊她也不愿意这样啊、实在是生活所逼之类的话。\r\n吴念真的妈妈跟一些围观的三姑六婆都傻眼了，奋力阻止大婶撞墙自杀后，赶紧说：「吴念真应该是念错了意思，要大婶等到正港的师傅出马读信再说。」\r\n众人眼巴巴盼着师傅从矿坑回来，立刻把信奉上，师傅有条不紊地念了起来：「我很喜欢你的女儿，虽然现在因为种种现实原因无法在一起，真的非常遗憾，贫穷不是妳愿意的，我也能体谅妳的处境，如果将来还有缘份，希望还是能跟你的女儿在一起。」正念完了，完全傻眼的吴念真被他爸毒打了一顿，罪名是乱读信。\r\n有好几天，屁股烂掉的吴念真 正眼都不看师傅一眼，远远看见就避开。\r\n直到被师傅叫住，拉到一旁。\r\n师傅说，你读的内容没有错，但那样读只会白白伤了大婶的心。\r\n既然两人都已经分手了，是既定事实了，不如把内容圆一下！\r\n最后只要把「意思传达出来就好了」。（其实，我必须吐槽，那意思一点都不对）。\r\n当时年纪还小的吴念真虽然不是很懂，但还是勉强领受了。\r\n几天后，矿坑塌陷。师傅走了！吴念真哭得不能自己。\r\n他说，他这辈子就看过这么一个真正的「知识分子」。\r\n \r\n师傅让吴念真知道，所谓真正的知识分子，是自己的知识贡献给知识比他低的人，而不是反过来利用知识，去掠夺知识比他不足的人。\r\n \r\n他的一生中，就只有当年乱打盘尼西林的师傅符合这样的标准。\r\n我想，这就是一颗柔软的心吧。\r\n \r\n当然这是吴念真心中的知识分子典型。',28,2,28,27,0,1,NULL,'2013-03-30 13:21:00',1),('/static/upload/post_img/2013/5/13/201351375745_a9aec2383e6d2ef4520e7e7482e9da46','','Conan','',28,4,26,28,NULL,0,NULL,'2013-05-12 23:58:06',0);
